import React from "react";

function Skills() {
  return (
    <section>
      <h2>Yetenekler</h2>
      <ul>
        <li>JavaScript</li>
        <li>React</li>
        <li>Node.js</li>
        <li>HTML & CSS</li>
        <li>C#</li>
        <li>PHP & MySQL</li>
        <li>Python</li>
        
      </ul>
    </section>
  );
}

export default Skills;
